import React from "react";
// import { Grid } from "@material-ui/core";

function Main() {
  return (
    <div>
      <h1>Our Voice Technology is Trusted By</h1>
      <p>
        Proprietary and built from the ground up, our technology voice-enables
        remote learning literacy and language tools, toys and games for kids
        ages 3-12 years.
      </p>
    </div>
  );
}

export default Main;
